                          {hasVariant(globalVariants, "screen", "smallMobile")
                            ? "\u06a9\u0627\u0631\u0628\u0631 \u0628\u0627 \u062b\u0628\u062a \u0646\u0627\u0645 \u062f\u0631 \u0631\u0646\u062a\u0627\u0645\u0648\u0646 \u0645\u06cc\u200c\u067e\u0630\u06cc\u0631\u062f \u06a9\u0647 \u0642\u0648\u0627\u0646\u06cc\u0646 \u0648 \u0645\u0642\u0631\u0631\u0627\u062a \u0631\u0646\u062a\u0627\u0645\u0648\u0646 \u0631\u0627 \u0628\u0647 \u0635\u0648\u0631\u062a \u06a9\u0627\u0645\u0644 \u0645\u0637\u0627\u0644\u0639\u0647 \u06a9\u0631\u062f\u0647\u060c \u0628\u0647 \u0645\u0641\u0627\u062f \u0622\u0646 \u0622\u06af\u0627\u0647 \u0648 \u062a\u0645\u0627\u0645 \u0645\u0648\u0627\u0631\u062f \u0622\u0646 \u0631\u0627 \u067e\u0630\u06cc\u0631\u0641\u062a\u0647 \u0627\u0633\u062a. \u062f\u0631 \u0635\u0648\u0631\u062a\u06cc\u06a9\u0647 \u062f\u0631 \u0622\u06cc\u0646\u062f\u0647 \u062f\u0631 \u0627\u06cc\u0646 \u0642\u0648\u0627\u0646\u06cc\u0646 \u0648 \u0645\u0642\u0631\u0631\u0627\u062a \u062a\u063a\u06cc\u06cc\u0631\u0627\u062a\u06cc \u0627\u06cc\u062c\u0627\u062f \u0634\u0648\u062f\u060c \u062f\u0631 \u0647\u0645\u06cc\u0646 \u0635\u0641\u062d\u0647 \u0628\u0647\u200c\u0631\u0648\u0632\u0631\u0633\u0627\u0646\u06cc \u0648 \u0645\u0646\u062a\u0634\u0631 \u0645\u06cc\u200c\u0634\u0648\u062f \u0648 \u06a9\u0627\u0631\u0628\u0631 \u062a\u0648\u0627\u0641\u0642 \u0645\u06cc\u200f\u200c\u06a9\u0646\u062f \u06a9\u0647 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0645\u0633\u062a\u0645\u0631 \u0627\u0632 \u0633\u0627\u06cc\u062a \u0628\u0647\u200c\u0645\u0639\u0646\u06cc \u067e\u0630\u06cc\u0631\u0634 \u0647\u0631\u06af\u0648\u0646\u0647 \u062a\u063a\u06cc\u06cc\u0631 \u0627\u0633\u062a."
                            : "\u06a9\u0627\u0631\u0628\u0631 \u0628\u0627 \u062b\u0628\u062a \u0646\u0627\u0645 \u062f\u0631 \u0631\u0646\u062a\u0627\u0645\u0648\u0646 \u0645\u06cc\u200c\u067e\u0630\u06cc\u0631\u062f \u06a9\u0647 \u0642\u0648\u0627\u0646\u06cc\u0646 \u0648 \u0645\u0642\u0631\u0631\u0627\u062a \u0631\u0646\u062a\u0627\u0645\u0648\u0646 \u0631\u0627 \u0628\u0647 \u0635\u0648\u0631\u062a \u06a9\u0627\u0645\u0644 \u0645\u0637\u0627\u0644\u0639\u0647 \u06a9\u0631\u062f\u0647\u060c \u0628\u0647 \u0645\u0641\u0627\u062f \u0622\u0646 \u0622\u06af\u0627\u0647 \u0648 \u062a\u0645\u0627\u0645 \u0645\u0648\u0627\u0631\u062f \u0622\u0646 \u0631\u0627 \u067e\u0630\u06cc\u0631\u0641\u062a\u0647 \u0627\u0633\u062a. \u062f\u0631 \u0635\u0648\u0631\u062a\u06cc\u06a9\u0647 \u062f\u0631 \u0622\u06cc\u0646\u062f\u0647 \u062f\u0631 \u0627\u06cc\u0646 \u0642\u0648\u0627\u0646\u06cc\u0646 \u0648 \u0645\u0642\u0631\u0631\u0627\u062a \u062a\u063a\u06cc\u06cc\u0631\u0627\u062a\u06cc \u0627\u06cc\u062c\u0627\u062f \u0634\u0648\u062f\u060c \u062f\u0631 \u0647\u0645\u06cc\u0646 \u0635\u0641\u062d\u0647 \u0628\u0647\u200c\u0631\u0648\u0632\u0631\u0633\u0627\u0646\u06cc \u0648 \u0645\u0646\u062a\u0634\u0631 \u0645\u06cc\u200c\u0634\u0648\u062f \u0648 \u06a9\u0627\u0631\u0628\u0631 \u062a\u0648\u0627\u0641\u0642 \u0645\u06cc\u200f\u200c\u06a9\u0646\u062f \u06a9\u0647 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0645\u0633\u062a\u0645\u0631 \u0627\u0632 \u0633\u0627\u06cc\u062a \u0628\u0647\u200c\u0645\u0639\u0646\u06cc \u067e\u0630\u06cc\u0631\u0634 \u0647\u0631\u06af\u0648\u0646\u0647 \u062a\u063a\u06cc\u06cc\u0631 \u0627\u0633\u062a."}
