                          {hasVariant(globalVariants, "screen", "smallMobile")
                            ? "\u0631\u0646\u062a\u0627\u0645\u0648\u0646 \u0627\u0632 \u0637\u0631\u06cc\u0642 \u062e\u0637\u0648\u0637 \u06f9\u06f9\u06f8\u06f2\u06f0\u06f0\u06f3\u06f7\u06f2\u06f7 \u0648 \u06f1\u06f0\u06f0\u06f0\u06f1\u06f0\u06f0\u06f1\u06f2\u06f4 \u067e\u06cc\u0627\u0645\u06a9\u200c\u0647\u0627\u06cc \u0627\u0637\u0644\u0627\u0639\u200c\u0631\u0633\u0627\u0646\u06cc \u062f\u0631 \u0631\u0627\u0628\u0637\u0647 \u0628\u0627 \u0648\u0642\u0627\u06cc\u0639 \u0645\u0631\u062a\u0628\u0637 \u0628\u0627 \u062d\u0633\u0627\u0628 \u06a9\u0627\u0631\u0628\u0631\u06cc\u060c \u0634\u0627\u0631\u0698 \u06a9\u06cc\u0641 \u067e\u0648\u0644\u060c \u0645\u0639\u0631\u0641\u06cc \u062e\u062f\u0645\u0627\u062a\u060c \u067e\u06cc\u0634\u0646\u0647\u0627\u062f\u0627\u062a\u060c \u062c\u0634\u0646\u0648\u0627\u0631\u0647\u200c\u0647\u0627 \u0648 \u062a\u062e\u0641\u06cc\u0641\u200c\u0647\u0627 \u0628\u0647 \u0634\u0645\u0627\u0631\u0647 \u0645\u0648\u0628\u0627\u06cc\u0644\u06cc \u06a9\u0647 \u06a9\u0627\u0631\u0628\u0631 \u0647\u0646\u06af\u0627\u0645 \u062b\u0628\u062a\u200c\u0646\u0627\u0645 \u062f\u0631 \u0628\u0631\u0646\u0627\u0645\u0647 \u062b\u0628\u062a \u06a9\u0631\u062f\u0647\u060c \u0627\u0631\u0633\u0627\u0644 \u0645\u06cc\u200c\u06a9\u0646\u062f. \u062f\u0631\u0635\u0648\u0631\u062a \u062f\u0631\u06cc\u0627\u0641\u062a \u067e\u06cc\u0627\u0645\u06a9 \u0628\u0627 \u0633\u0631\u0634\u0645\u0627\u0631\u0647\u200c\u0627\u06cc \u063a\u06cc\u0631 \u0645\u0648\u0627\u0631\u062f \u0645\u0630\u06a9\u0648\u0631\u060c \u0628\u0647 \u0622\u0646 \u0628\u06cc\u200c\u062a\u0648\u062c\u0647\u06cc \u06a9\u0631\u062f\u0647 \u0648 \u0628\u0647 \u0647\u06cc\u0686 \u0648\u062c\u0647 \u0628\u0631 \u0631\u0648\u06cc \u0644\u06cc\u0646\u06a9\u200c\u0647\u0627\u06cc \u0627\u062d\u062a\u0645\u0627\u0644\u06cc \u0646\u0632\u0646\u06cc\u062f."
                            : "\u0631\u0646\u062a\u0627\u0645\u0648\u0646 \u0627\u0632 \u0637\u0631\u06cc\u0642 \u062e\u0637\u0648\u0637 \u06f9\u06f9\u06f8\u06f2\u06f0\u06f0\u06f3\u06f7\u06f2\u06f7 \u0648 \u06f1\u06f0\u06f0\u06f0\u06f1\u06f0\u06f0\u06f1\u06f2\u06f4 \u067e\u06cc\u0627\u0645\u06a9\u200c\u0647\u0627\u06cc \u0627\u0637\u0644\u0627\u0639\u200c\u0631\u0633\u0627\u0646\u06cc \u062f\u0631 \u0631\u0627\u0628\u0637\u0647 \u0628\u0627 \u0648\u0642\u0627\u06cc\u0639 \u0645\u0631\u062a\u0628\u0637 \u0628\u0627 \u062d\u0633\u0627\u0628 \u06a9\u0627\u0631\u0628\u0631\u06cc\u060c \u0634\u0627\u0631\u0698 \u06a9\u06cc\u0641 \u067e\u0648\u0644\u060c \u0645\u0639\u0631\u0641\u06cc \u062e\u062f\u0645\u0627\u062a\u060c \u067e\u06cc\u0634\u0646\u0647\u0627\u062f\u0627\u062a\u060c \u062c\u0634\u0646\u0648\u0627\u0631\u0647\u200c\u0647\u0627 \u0648 \u062a\u062e\u0641\u06cc\u0641\u200c\u0647\u0627 \u0628\u0647 \u0634\u0645\u0627\u0631\u0647 \u0645\u0648\u0628\u0627\u06cc\u0644\u06cc \u06a9\u0647 \u06a9\u0627\u0631\u0628\u0631 \u0647\u0646\u06af\u0627\u0645 \u062b\u0628\u062a\u200c\u0646\u0627\u0645 \u062f\u0631 \u0628\u0631\u0646\u0627\u0645\u0647 \u062b\u0628\u062a \u06a9\u0631\u062f\u0647\u060c \u0627\u0631\u0633\u0627\u0644 \u0645\u06cc\u200c\u06a9\u0646\u062f. \u062f\u0631\u0635\u0648\u0631\u062a \u062f\u0631\u06cc\u0627\u0641\u062a \u067e\u06cc\u0627\u0645\u06a9 \u0628\u0627 \u0633\u0631\u0634\u0645\u0627\u0631\u0647\u200c\u0627\u06cc \u063a\u06cc\u0631 \u0645\u0648\u0627\u0631\u062f \u0645\u0630\u06a9\u0648\u0631\u060c \u0628\u0647 \u0622\u0646 \u0628\u06cc\u200c\u062a\u0648\u062c\u0647\u06cc \u06a9\u0631\u062f\u0647 \u0648 \u0628\u0647 \u0647\u06cc\u0686 \u0648\u062c\u0647 \u0628\u0631 \u0631\u0648\u06cc \u0644\u06cc\u0646\u06a9\u200c\u0647\u0627\u06cc \u0627\u062d\u062a\u0645\u0627\u0644\u06cc \u0646\u0632\u0646\u06cc\u062f."}
