                          "\r\n\u062f\u0631\u0635\u0648\u0631\u062a \u0628\u0631\u0648\u0632 \u062e\u0637\u0627\u06cc \u0633\u06cc\u0633\u062a\u0645\u06cc \u0648 \u062e\u0633\u0627\u0631\u062a \u0648\u0627\u0631\u062f \u0634\u062f\u0646 \u0628\u0647 \u06a9\u0627\u0631\u0628\u0631\u060c \u062f\u0631\u0635\u0648\u0631\u062a \u0645\u0633\u062c\u0644 \u0634\u062f\u0646 \u0627\u062e\u062a\u0644\u0627\u0644 \u0648 \u062e\u0637\u0627 \u0627\u0632 \u0633\u0645\u062a \u0631\u0646\u062a\u0627\u0645\u0648\u0646\u060c \u0631\u0646\u062a\u0627\u0645\u0648\u0646 \u062e\u0633\u0627\u0631\u062a \u06a9\u0627\u0631\u0628\u0631 \u0631\u0627 \u062a\u0627 \u0633\u0642\u0641 \u06f3 \u0645\u06cc\u0644\u06cc\u0648\u0646 \u062a\u0648\u0645\u0627\u0646 \u062c\u0628\u0631\u0627\u0646 \u0645\u06cc\u200c\u0646\u0645\u0627\u06cc\u062f.\r"
